function getIpInfo(){var e="https://api.qjqq.cn/api/Local";fetch(e).then(e=>e.json()).then(e=>{document.getElementById("userAgentIp").innerHTML=e.ip,document.getElementById("userAgentCountry").innerHTML=e.data.country,document.getElementById("userAgentRegion").innerHTML=e.data.prov,document.getElementById("userAgentCity").innerHTML=e.data.city,document.getElementById("userAgentIsp").innerHTML=e.data.isp;var n=navigator.userAgent;document.getElementById("userAgentDevice").innerHTML=n})}getIpInfo();